import './Navbar.css';

function Navbar() {
  return (
    <div className="Navbar">
        <button className="HomeButton"><i class="fa-solid fa-bars"></i>Aadi Kulshrestha</button>
        <button className="SidebarButton"><i class="fa-solid fa-bars"></i></button>
    </div>
  );
}

export default Navbar;
